import React from 'react';
import {Container, Row, Col} from 'react-bootstrap';
import 'bootstrap/dist/css/bootstrap.min.css';
import './header.css';

const Header = () => {
    return (
        <>
            <Container fluid>
                <Row>
                    <Col lg={10}>
                        Where in the world?

                    </Col>
                    <Col lg={2}>
                        Light/Dark
                    </Col>
                </Row>
            </Container>
        </>
    )
}

export default Header;
